import { Component, OnInit } from '@angular/core';

@Component({
  selector: 'app-propertybinding-example',
  templateUrl: './propertybinding-example.component.html',
  styleUrls: ['./propertybinding-example.component.css']
})
export class PropertybindingExampleComponent implements OnInit {
  name:string = ""
  dob:string = ""
  pic:string = ""
  rand_val:number = 0
 
 
  constructor() { 
  this.rand_val = Math.random()
  this.name = this.get_name()
  this.dob = this.get_dob()
  this.pic = this.get_pic()
  }
  get_name() {
    if (this.rand_val < 0.3){
        return "sachin"
    }
    else if(this.rand_val > 0.3 && this.rand_val < 0.6){
        return "dhoni"
    }
    else{
      return "kohli"
    }
  }
  get_dob() {
    if (this.rand_val < 0.3){
        return "24 April 1973"
    }
    else if(this.rand_val > 0.3 && this.rand_val < 0.6){
        return "7 July 1981 "
    }
    else{
      return "5 November 1988"
    }
  }
  get_pic() {
    if (this.rand_val < 0.3){
        return "data:image/jpeg;base64,"
    }
    else if(this.rand_val > 0.3 && this.rand_val < 0.6){
        return "data:image/jpeg;base64,"
    }
    else{
      return "data:image/jpeg;base64,"
    }
  }
  
  ngOnInit(): void {
  }

}
